    constructor(props) {
        super(props);
        this.state ={
            userId:'',
            title:'',

        }
    }
    
    render(){
        return (
            <div>
                <form>
                    <div>
                        <input type="text" name="userid">User Id</input>
                    </div>
                    <div>
                        <input type="text" name="title">Title</input>
                    </div>
                    <div>
                        <input type="text" name="body">Body</input>
                    </div>
                    
                    
                </form>
            </div>
        )
    }

}

export default Postform
